INSERT INTO `sambutans` VALUES (0x35656431303263356333623334, 'Website ini kami hadirkan sebagai media informasi Pemerintahan Desa kepada masyarakat. Juga sebagai sarana interaksi, komunikasi dan transparansi publik sesuai dengan Undang-undang keterbukaan informasi. Terima kasih kepada semua pihak yang telah banyak memberikan dukungan dan kontribusi, baik berupa tenaga, pemikiran dan semangat, hingga Website ini dapat terealisasi. Semoga dengan adanya Website Desa Pedekik ini dapat bermanfaat dan menjadi salah satu upaya peningkatan pelayanan desa. Untuk itu kritik, saran, dan masukan yang konstruktif, kreatif dan inovatif sangat kami nantikan demi terwujudnya program pemerintahan desa yang terarah dan mengedepankan musyawarah dan mufakat. ', '2020-05-29 07:40:37', NULL, NULL, 'admin');

