INSERT INTO `surats` VALUES ('5ed11f937e4c9', 'SURAT PENGANTAR PENELITIAN', 'SPP', '<p style=\"box-sizing: inherit; margin-bottom: 2rem;\"><span style=\"font-size: 1rem;\">Yang bertanda tangan dibawah ini Ketua RT 06/RW 07. Dengan surat ini menerangkan bahwa :</span><br></p>', '<p>Nama tersebut diatas merupakan warga desa saya yang beralamat diatas ingin melakukan penelitian terhadap hewan ternak sapi yang ada di peternakan sapi Desa Purwodadi. Dan akan melaksanakan penelitian pada tanggal 27 November 2018. Mohon pengertiannya.<br></p>', '<p>Demikian surat pengantar ini saya buat dengan sebenar-benarnya dan untuk digunakan sebagaimana mestinya.<br></p>', '5ea67e89e2639', '5ea54f0d29a21', '2020-05-29 09:43:31', '2020-05-29 09:43:31', NULL);

